    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on John H. Chafee NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how John H. Chafee NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a description of Refuge
    resources, information on the management direction, and strategies for implementation
    and monitoring. Key planning issues include: threatened and endangered species,
    restoration of coastal sandplain communities, restoration of wetlands, water quality,
    control of invasive species, protection of biologically significant areas, public
    use, hunting, and environmental education.",nt"license_title": "License Not
